import React from 'react';
import { Row, Col,Container } from 'react-bootstrap';

function content(props){
    return(
        <Container fluid={true}>
            <Row className="justify-content-center">
                <Col md={8}>
                    {props.children}
                </Col>
            </Row>
        </Container>
    );
}

export default content;
